
# -*- coding: utf-8 -*-

from remi.gui import *
from remi import start, App


class untitled(App):
    def __init__(self, *args, **kwargs):
        #DON'T MAKE CHANGES HERE, THIS METHOD GETS OVERWRITTEN WHEN SAVING IN THE EDITOR
        if not 'editing_mode' in kwargs.keys():
            super(untitled, self).__init__(*args, static_file_path={'my_res':'./res/'})

    def idle(self):
        #idle function called every update cycle
        pass
    
    def main(self):
        return untitled.construct_ui(self)
        
    @staticmethod
    def construct_ui(self):
        #DON'T MAKE CHANGES HERE, THIS METHOD GETS OVERWRITTEN WHEN SAVING IN THE EDITOR
        hbox0 = HBox()
        hbox0.attr_class = "HBox"
        hbox0.attr_editor_newclass = False
        hbox0.css_align_content = "center"
        hbox0.css_align_items = "center"
        hbox0.css_align_self = "center"
        hbox0.css_display = "block"
        hbox0.css_flex_direction = "row"
        hbox0.css_height = "1584px"
        hbox0.css_justify_content = "center"
        hbox0.css_overflow = "visible"
        hbox0.css_position = "absolute"
        hbox0.css_width = "1224px"
        hbox0.variable_name = "hbox0"
        image0 = Image()
        image0.attr_class = "Image"
        image0.attr_editor_newclass = False
        image0.attr_src = "data:image/png;base64,"
        image0.css_height = "50%"
        image0.css_order = "-1"
        image0.css_position = "static"
        image0.css_top = "20px"
        image0.css_width = "100%"
        image0.variable_name = "image0"
        hbox0.append(image0,'image0')
        button0 = Button()
        button0.attr_class = "Button"
        button0.attr_editor_newclass = False
        button0.css_align_self = "auto"
        button0.css_background_repeat = "repeat"
        button0.css_border_style = "solid"
        button0.css_height = "30px"
        button0.css_order = "-1"
        button0.css_position = "static"
        button0.css_top = "20px"
        button0.css_visibility = "visible"
        button0.css_width = "100px"
        button0.text = "button"
        button0.variable_name = "button0"
        hbox0.append(button0,'button0')
        progress0 = Progress()
        progress0.attr_class = "Progress"
        progress0.attr_editor_newclass = False
        progress0.attr_max = "100"
        progress0.attr_value = "3"
        progress0.css_height = "50px"
        progress0.css_order = "-1"
        progress0.css_position = "static"
        progress0.css_top = "20px"
        progress0.css_visibility = "visible"
        progress0.css_width = "250px"
        progress0.variable_name = "progress0"
        hbox0.append(progress0,'progress0')
        hbox0.children['button0'].onclick.do(self.onclick_button0)
        

        self.hbox0 = hbox0
        return self.hbox0
    
    def onclick_button0(self, emitter):
        pass



